import React from 'react';


function Navbar() {
  return (
    <nav className="navbar">
      <a href="#proyectos">Proyectos</a>
      <a href="#tecnologias">Tecnologías</a>
      <a href="#sobremi">Sobre mí</a>
      <a href="#contacto">Contacto</a>
    </nav>
  );
};

export default Navbar;
